function ForgotPassword(props) {
    return(
        <div className="forgotPassword">
            <h2 id='fpId'>Forgot Password?</h2>
            <p id='fpPara'>Enter the email address associated with your account.</p>
            <br></br>
            <form className='fp_Container'>

                <div className='formContainer'>
                    <div>
                        <label className='inputLabel'>Email
                            <span className='asterick'>*</span> 
                            </label>
                        <br></br>
                        <input className='inputArea' type="email" required></input>
                    </div>
                    <div className='submitDiv'>
                        <button type="submit" className="sendButton">SEND</button>
                    </div>
                    <div className='backToLoginDiv'>
                        Back to
                        <Link to='/' className='backToLoginLink , buttonLink'>Log in</Link>
                    </div>
                </div>
            </form>
        </div>
    );
}
export default ForgotPassword;
